import './App.css';
import { AuthProvider } from './Context'
import { BrowserRouter as Router, Route, Switch} from 'react-router-dom';

import { PrincipalClub, SelectGanadores, CampeonatosClub, LoginClub, NuevoCampeonato } from './Pages'




function App() {
  return (
    <AuthProvider>
      <PrincipalClub/>
    </AuthProvider>
    
  );
}

export default App;

